actionConfiguration.body:
() => {

		let formDataValue = GoodwillForm.formData;


		formDataValue['userName'] = appsmith.user.email ;
		storeValue("goodwill_payload",formDataValue);
		//navigateTo("ListingPage",{ "campaigns": [272,278]});

		// Calling Create Goodwill config API
	CreateGoodwillConfigApi.run(
			// On success
			()=>{
				showAlert("Goodwill Config Created successfully");
				navigateTo("ListingPageGoodwill");

			},
			// On error
			()=>{
				showAlert("Something went wrong");
			}
		);


	}

